  04> DODGSHUN, Kenneth Christopher m on 05.10.1951 to SNUSHALL, Wenda Joy
  b 15.10.1927
  b 12.07.1930
  Christopher b. and m. at Gisborne. Wenda, d/o Samuel Snushall and Molly
  Renwick, b. at Oamaru, Address: 17 Mill Road, Gisborne.
  Chris was educated at Wanganui Collegiate School, (1942-45). He was in the
  Ist rugby XV and the 1st rowing 4s and 8s in 1945, and was senior swimming
  champion in 1944 and 1945. After leaving school he worked on East Coast
  stations and for a short time with an agricultural contractor in the South
  Island until 1950 when he moved to Muriwai to work on "Sherwood" station. In 1951 he moved to manage
  the adjoining "Coventry" station and later went into partnership with the family of Claud Herbert
  Williams. In 1965 he established the Coventry Perendale Stud and was appointed a judge for the
  Perendale Society. The stud was sold and the partnership dissolved in 1982.
  Chris then developed a citrus orchard and a small farmlet and moved to Gisborne. He retired in 1994.
